package scaler.assigments.homework;

import java.util.Stack;

public class Advance_Stack1_Assignment_Q2 {

	public static void main(String args[]) {
		String input = "";
		String res = new Advance_Stack1_Assignment_Q2().solve(input);
		System.out.println(res);

	}

	public String solve(String A) {
		Stack<String> stack = new Stack<String>();

		for (int i = A.length() - 1; i >= 0; i--) {
			char ch = A.charAt(i);

			if (stack.isEmpty())
				stack.push(String.valueOf(ch));
			else {
				if (!stack.isEmpty() && String.valueOf(ch).equals(stack.peek())) {
					stack.pop();
				} else {
					stack.push(String.valueOf(ch));
				}
			}

		}

		StringBuilder sb = new StringBuilder();

		while (!stack.isEmpty()) {
			sb.append(stack.pop());
		}

		return sb.toString();
	}

}
